const CompanyTextColumn = () => {
  return (
    <div className="col-md-6">
      <div className="tm-about-1">
        <img src="img/img-3x1-01.jpg" alt="Image" className="img-fluid mb-5" />
        <p className="tm-article-text">
          Phasellus blandit tortor vel odio hendrerit, eleifend ultricies odio
          temport. Etiam euismod, lectus convallis efficitur convallis, risus
          orci auctor orci.
        </p>
        <p>
          Cras imperdiet in ligula sit amet fringilla. Morbi posuere mattis
          ornare. Nunc iaculis porta ipsum. Aliquam vehicula egestas diam auctor
          ornare.
        </p>
      </div>
    </div>
  );
};
export default CompanyTextColumn;
